import React from "react"

function ImageThumbnail(props){
    console.log(props);
    return(
        <img onClick={props.onClick} src={props.src} value={props.value} idTag={props.idTag} alt="..." className="img-thumbnail"></img>
    )
}

export default ImageThumbnail;
